import React from 'react';
import './App.css';

async function Users() {
    React.useEffect(() => {
        fetchItems();
    }, []);

    const fetchItems = async () => {
        const data = await fetch("/");
        const json = await data.json();
        return json
    }

    var data = fetchItems();

    return (
        <div>
            <h1>Users Page</h1>
        </div>
    );
}

export default Users;
